import AssistanceType from "./assistanceType";
import FirstStep from "./firstStep";

import {
  Button,
  Typography,
  Paper,
  FormControl,
  Grid,
  RadioGroup,
  Radio,
  FormControlLabel,
} from "@material-ui/core";
import { useState } from "react";

const AppointmentForm = () => {
  const [step, setStep] = useState(0);

  switch (step) {
    case 0:
      return <AssistanceType setStep={setStep} />;
    case 1:
      return <FirstStep setStep={setStep} />;
    case 2:
      return <SecondStep setStep={setStep} />;
    case 3:
      return <CompletedStep />;
  }
};

const CompletedStep = () => {
  return (
    <Paper align="center" style={{ height: 300, marginTop: 20, padding: 20 }}>
      <h1>Completed!</h1>
    </Paper>
  );
};

export default AppointmentForm;
